ADDR1, ADDR2, ADDR3, ADDR4, ADDR5 
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT,
A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS, A.RES_RUID,
A.CNTRY_RUID, A1.LOV_ID AS CNTRY_ID, A1.LOV_NM AS CNTRY_NM,
A.CITY_RUID, A2.LOV_ID AS CITY_ID, A2.LOV_NM AS CITY_NM,
A.CITY_OTHNAME, A.ZIP, A.ADDR_TYP,
A.ADDR1, A.ADDR2, A.ADDR3, A.ADDR4, A.ADDR5 
FROM MST01RSRC_ADDR A
LEFT OUTER JOIN MST01LOV_CNTRY A1 ON A.CNTRY_RUID = A1.RUID
LEFT OUTER JOIN MST01LOV_CITY A2 ON A.CITY_RUID = A2.RUID
GO
