CREATE VIEW [dbo].[VWAC01USR_INFO]
(
ADTRL_WKS, ADTRL_IP, ADTRL_USR, ADTRL_PRG, ADTRL_DT, RSEQNO, RUID, DTA_STS, BP_STS,
ROLE_RUID, ROLE_ID, ROLE_NM, ROLE_LANGID,
USR_PSWD, USR_ID, USR_NM1, USR_NM2, USR_NM3, USR_NM4, USR_NM5,
RES_RUID, RES_ID, RES_NM1, RES_NM2, RES_NM3,
DEPT_RUID, DEPT_ID, DEPT_NM,
BRNCH_RUID, BRNCH_ID, BRNCH_NM,
JOB_TITLE_RUID, JOB_TITLE_ID, JOB_TITLE_NM,
RES_TYPE, IMG_SRC
) AS
SELECT
A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
A.ROLE_RUID, A14.ROLE_ID AS ROLE_ID, A14.ROLE_CAPTION AS ROLE_NM, A14.ROLE_LANG_ID AS ROLE_LANGID,
A.USR_PSWD, A.USR_ID, A.USR_NM1, A.USR_NM2, A.USR_NM3, A.USR_NM4, A.USR_NM5,
A.RES_RUID, A1.RES_ID, A1.RES_NM1, A1.RES_NM2, A1.RES_NM3,
A1.DEPT_RUID, A11.LOV_ID AS DEPT_ID, A11.LOV_NM AS DEPT_NM,
A1.BRNCH_RUID, A12.LOV_ID AS BRNCH_ID, A12.LOV_NM AS BRNCH_NM,
A1.JOB_TITLE_RUID, A13.LOV_ID AS JOB_TITLE_ID, A13.LOV_NM AS JOB_TITLE_NM,
A1.RES_TYPE, A1.IMG_SRC
FROM AC01USR A
LEFT OUTER JOIN MST01RSRC A1 ON A.RES_RUID = A1.RUID
LEFT OUTER JOIN MST01LOV_DEPT A11 ON A1.DEPT_RUID = A11.RUID
LEFT OUTER JOIN MST01LOV_BRNCH A12 ON A1.BRNCH_RUID = A12.RUID
LEFT OUTER JOIN MST01LOV_JOBTTL A13 ON A1.JOB_TITLE_RUID = A13.RUID
LEFT OUTER JOIN AC01ROLE A14 ON A.ROLE_RUID = A14.RUID
GO
