ADDR1_DMCL, ADDR2_DMCL, ADDR3_DMCL, ADDR4_DMCL, ADDR5_DMCL,
POB_NM
) AS
select A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.BP_STS,
       A.DEPT_RUID, A.BRNCH_RUID, A.CMPNY_RUID, A.JOB_TITLE_RUID, A.JOB_TITLE_NM, A.RELIGION_RUID, A.RES_TYPE, A.RES_ID,
    A.RES_NM1, A.RES_NM2, A.RES_NM3, A.RES_XID1, A.RES_XID2, A.RES_XID3, A.RES_XID4, A.RES_XID5,
    A.RES_XNM1, A.RES_XNM2, A.RES_XNM3, A.RES_XNM4, A.RES_XNM5,
    A.SEX, A.MRTL_STS, A.POB, A.DOB, A.JOIN_DT, A.NPWP, A.JAMSOSTEK_NO,
    A.PHN_HMO1, A.PHN_HMO2, A.PHN_HMO3, A.PHN_HMO4, A.PHN_HMO5, A.PHN_MBL1, A.PHN_MBL2, A.PHN_MBL3, A.PHN_MBL4, A.PHN_MBL5,
    A.PHN_OFF1, A.PHN_OFF2, A.PHN_OFF3, A.PHN_OFF4, A.PHN_OFF5, A.FAX1, A.FAX2, A.FAX3, A.FAX4, A.FAX5,
    A.MAIL1, A.MAIL2, A.MAIL3, A.MAIL4, A.MAIL5, A.WEBSITE1, A.WEBSITE2, A.WEBSITE3, A.WEBSITE4, A.WEBSITE5,
    A.CP1_NM, A.CP1_PHN_HMO, A.CP1_PHN_MBL, A.CP1_MAIL, A.CP1_WEBSITE, A.CP2_NM, A.CP2_PHN_HMO, A.CP2_PHN_MBL, A.CP2_MAIL, A.CP2_WEBSITE,
    A.RMK, A.NOTES, A.ADD_RMK1, A.ADD_RMK2, A.ADD_RMK3, A.ADD_RMK4, A.ADD_RMK5, A.ADD_FLD1, A.ADD_FLD2, A.ADD_FLD3, A.ADD_FLD4, A.ADD_FLD5,
    A.BIZ_ACT, A.RES_STS, A.RES_STS_STARTDT, A.RES_STS_ENDDT, A.IMG_SRC,
		B.RUID AS RSRC_ADDR_RIC_RUID, B.CNTRY_RUID AS CNTRY_RIC_RUID, B.CNTRY_NM AS CNTRY_NM_RIC,
    B.CITY_RUID AS CITY_RIC_RUID, B.CITY_NM AS CITY_NM_RIC, B.ZIP AS ZIP_RIC, B.ADDR_TYP AS ADDR_TYP_RIC,
    B.ADDR1 AS ADDR1_RIC, B.ADDR2 AS ADDR2_RIC, B.ADDR3 AS ADDR3_RIC, B.ADDR4 AS ADDR4_RIC, B.ADDR5 AS ADDR5_RIC,
    C.RUID AS RSRC_ADDR_DMCL_RUID, C.CNTRY_RUID AS CNTRY_DMCL_RUID, C.CNTRY_NM AS CNTRY_NM_DMCL,
    C.CITY_RUID AS CITY_DMCL_RUID, C.CITY_NM AS CITY_NM_DMCL, C.ZIP AS ZIP_DMCL, C.ADDR_TYP AS ADDR_TYP_DMCL,
    C.ADDR1 AS ADDR1_DMCL, C.ADDR2 AS ADDR2_DMCL, C.ADDR3 AS ADDR3_DMCL, C.ADDR4 AS ADDR4_DMCL, C.ADDR5 AS ADDR5_DMCL,
    D.LOV_NM AS POB_NM
from MST01RSRC A
     LEFT OUTER JOIN VWMST01RSRC_ADDR_CSTM_RIC B ON A.RUID = B.RES_RUID
     LEFT OUTER JOIN VWMST01RSRC_ADDR_CSTM_DMCL C ON A.RUID = C.RES_RUID
     LEFT OUTER JOIN MST01LOV_CITY D ON A.POB = D.RUID
WHERE A.RES_TYPE = 'EMP';
GO
