PACPT_SCLE_VAL1, PACPT_SCLE_VAL2,
PACPT_SCLE_UOM, PACPT_SCLE_VALTYPE,
PACPT_SCLE_RNGOPRRUID, PACPT_SCLE_SEQ,
NOTES1, NOTES2
) AS
SELECT A.ADTRL_WKS, A.ADTRL_IP, A.ADTRL_USR, A.ADTRL_PRG, A.ADTRL_DT, A.RSEQNO, A.RUID, A.DTA_STS, A.ACT_YEAR,
       A.ACT_TYPE, A.BIZ_ACT, A.BP_STS, A.COEFFCLS_RUID,
       A.RES_RUID, A.CPYASM_DT,
       A.CPYEVL_RES_RUID, ISNULL(C1.RES_NM1,'')+ISNULL(C1.RES_NM2,'')+ISNULL(C1.RES_NM3,'') AS CPYEVL_RES_NM, A.CPYEVL_DT,
       A.CPYAPV_RES_RUID, ISNULL(C2.RES_NM1,'')+ISNULL(C2.RES_NM2,'')+ISNULL(C2.RES_NM3,'') AS CPYAPV_RES_NM, A.CPYAPV_DT,
       A.KPIEVL_RES_RUID, ISNULL(C3.RES_NM1,'')+ISNULL(C3.RES_NM2,'')+ISNULL(C3.RES_NM3,'') AS KPIEVL_RES_NM, A.KPIEVL_DT,
       A.KPI_SR, A.KPI_WGHT, A.KPI_SRBYWGHT,
       A.CPY_SR, A.CPY_WGHT, A.CPY_SRBYWGHT,
       A.FINAL_SR, A.FINAL_SR_RUID, A.PACPT_SCLE_RUID, D.LOV_NM AS PACPT_SCLE_NM,
       D.LOV_TYPE AS PACPT_SCLE_TYPE, D.LOV_SUBTYPE AS PACPT_SCLE_SUBTYPE,
