       D.RNGOPR_RUID AS PACPT_SCLE_RNGOPRRUID, D.LOV_SEQ1 AS PACPT_SCLE_SEQ,
       A.NOTES1, A.NOTES2
FROM VWHRS01TRN_PA_BYACTYR A
LEFT OUTER JOIN MST01RSRC C1 ON A.CPYEVL_RES_RUID = C1.RUID
LEFT OUTER JOIN MST01RSRC C2 ON A.CPYAPV_RES_RUID = C2.RUID
LEFT OUTER JOIN MST01RSRC C3 ON A.KPIEVL_RES_RUID = C3.RUID
LEFT OUTER JOIN VWHRS01LOV_PACPT_SCLE_BYACTYR D ON A.PACPT_SCLE_RUID = D.RUID;
