CREATE VIEW [dbo].[VWMST01EMPLOYEEDASH_STS_INFO]
(
RSEQNO, RUID,
EMP_PRMT, EMP_CONT,
EMP_PROB, EMP_OUTSRC
) AS
SELECT
1 AS RSEQNO, 'RUID_1' AS RUID,
SUM(A.EMP_PRMT) AS EMP_PRMT, SUM(A.EMP_CONT) AS EMP_CONT,
SUM(A.EMP_PROB) AS EMP_PROB, SUM(A.EMP_OUTSRC) AS EMP_OUTSRC
FROM (
SELECT
CASE WHEN ISNULL(RES_STS,'')='LOV_HRS_EMPSTS_PRMT' THEN 1 ELSE 0 END AS EMP_PRMT,
CASE WHEN ISNULL(RES_STS,'')='LOV_HRS_EMPSTS_CONT' THEN 1 ELSE 0 END AS EMP_CONT,
CASE WHEN ISNULL(RES_STS,'')='LOV_HRS_EMPSTS_PROB' THEN 1 ELSE 0 END AS EMP_PROB,
CASE WHEN ISNULL(RES_STS,'')='LOV_HRS_EMPSTS_OUTSRC' THEN 1 ELSE 0 END AS EMP_OUTSRC
FROM VWMST01EMPLOYEEACTIVE_INFO ) A;
GO
