CREATE VIEW [dbo].[VWHRS01PRVLG_AUTHPERSON_INFO]
(
ADTRL_WKS,
ADTRL_IP,
ADTRL_USR,
ADTRL_PRG,
ADTRL_DT,
RSEQNO,
RUID,
DTA_STS,
ACT_YEAR,
RES_RUID,
PAUTH_RUID,
LOVPAAUTH_RUID, LOVPAAUTH_NM, LOVPAAUTH_SEQ,
MSTRES_RUID, MSTRES_ID, MSTRES_XID1,
MSTRES_NM, MSTRES_NM1, MSTRES_NM2, MSTRES_NM3,
MSTCMPNY_RUID, MSTBRNCH_RUID, MSTBRNCH_NM,
MSTDEPT_RUID, MSTDEPT_NM, MSTJOBTTL_RUID, MSTJOBTTL_NM,
JOBTTL_RUID, JOBTTL_NM, JOBTTLGRP_RUID, JOBTTLGRP_NM, JOBTTLSUBGRP_RUID, JOBTTLSUBGRP_NM,
DISP_KEY
) AS
SELECT 
    (SELECT X1.ADTRL_WKS 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS ADTRL_WKS,
    (SELECT X1.ADTRL_IP 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS ADTRL_IP,
    (SELECT X1.ADTRL_USR 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS ADTRL_USR,
    (SELECT X1.ADTRL_PRG 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS ADTRL_PRG,
    (SELECT X1.ADTRL_DT 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS ADTRL_DT,
    (SELECT X1.RSEQNO 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS RSEQNO,
    (SELECT X1.RUID 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS RUID,
    (SELECT X1.DTA_STS 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS DTA_STS,
    (SELECT X1.ACT_YEAR 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS ACT_YEAR,
    (SELECT X1.RES_RUID 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS RES_RUID,
    (SELECT X1.PAUTH_RUID 
    FROM VWHRS01PRVLG_PA_AUTH_BYACTYR X1 
    WHERE X1.PAUTH_RUID = A.RUID AND X1.RES_RUID = B.MSTRES_RUID) AS PAUTH_RUID,
    A.RUID AS LOVPAAUTH_RUID, A.LOV_NM AS LOVPAAUTH_NM, A.LOV_SEQ1 AS LOVPAAUTH_SEQ,
    B.MSTRES_RUID, B.MSTRES_ID, B.MSTRES_XID1,
    B.RES_NM AS MSTRES_NM, B.RES_NM1 AS MSTRES_NM1, B.RES_NM2 AS MSTRES_NM2, B.RES_NM3 AS MSTRES_NM3,
  B.MSTCMPNY_RUID, B.MSTBRNCH_RUID, B.MSTBRNCH_NM,
    B.MSTDEPT_RUID, B.MSTDEPT_NM, B.MSTJOBTTL_RUID, B.MSTJOBTTL_NM,
  B.JOBTTL_RUID, B.JOBTTL_NM, B.JOBTTLGRP_RUID, B.JOBTTLGRP_NM, B.JOBTTLSUBGRP_RUID, B.JOBTTLSUBGRP_NM,
  isnull(B.MSTRES_RUID,'')+isnull(A.RUID,'') AS DISP_KEY
FROM HRS01LOV_PA_AUTH A, VWMST01RSRC_HRS_CSTM_EMP B;
GO
