A4.LOV_VAL1 AS PACPT_LOVVAL1, A4.LOV_VAL2 AS PACPT_LOVVAL2,
A4.UOM AS PACPTUOM_RUID, A4.UOM_ID AS PACPTUOM_ID, A4.UOM_NM AS PACPTUOM_NM, A4.UOM_SEQ1 AS PACPTUOM_SEQ1, A4.UOM_SYM AS PACPTUOM_SYM,
A4.VAL_TYPE AS PACPT_VALTYPE,
A4.RNGOPR_RUID AS PACPTOPR_RUID, A4.RNGOPR_ID AS PACPTOPR_ID, A4.RNGOPR_NM AS PACPTOPR_NM, A4.RNGOPR_SYM1 AS PACPTOPR_SYM1, A4.RNGOPR_SYM2 AS PACPTOPR_SYM2,
A4.LOV_SEQ1 AS PACPTLOV_SEQ1,
A.NOTES1, A.NOTES2
FROM HRS01TRN_PA A
LEFT OUTER JOIN HRS01LOV_PA_BIZACT A1 ON A.BIZ_ACT = A1.RUID
LEFT OUTER JOIN HRS01LOV_PA_BIZACT_STS A2 ON A.BP_STS = A2.RUID
LEFT OUTER JOIN VWHRS01LOV_PACPT_SCLE_INFO A3 ON A.FINAL_SR_RUID = A3.RUID
LEFT OUTER JOIN VWHRS01LOV_PACPT_SCLE_INFO A4 ON A.PACPT_SCLE_RUID = A4.RUID
LEFT OUTER JOIN VWHRS01REL_JOBTTL_RESEMP_INFO B1 ON A.RES_RUID = B1.RES_RUID
      AND A.ACT_YEAR = B1.ACT_YEAR
			AND A.TRX_YEAR = B1.TRX_YEAR
LEFT OUTER JOIN VWHRS01REL_JOBTTL_RESEMP_INFO B2 ON A.CPYEVL_RES_RUID = B2.RES_RUID
      AND A.ACT_YEAR = B2.ACT_YEAR
			AND A.TRX_YEAR = B2.TRX_YEAR
LEFT OUTER JOIN VWHRS01REL_JOBTTL_RESEMP_INFO B3 ON A.CPYAPV_RES_RUID = B3.RES_RUID
      AND A.ACT_YEAR = B3.ACT_YEAR
			AND A.TRX_YEAR = B3.TRX_YEAR
LEFT OUTER JOIN VWHRS01REL_JOBTTL_RESEMP_INFO B4 ON A.KPIEVL_RES_RUID = B4.RES_RUID
      AND A.ACT_YEAR = B4.ACT_YEAR
			AND A.TRX_YEAR = B4.TRX_YEAR) A
LEFT OUTER JOIN VWHRS01REL_CLCBSE_WGHFNLCPY_INFO B1 ON A.JTLCLS_RUID = B1.JTLCLS_RUID
      AND A.ACT_YEAR = B1.ACT_YEAR
LEFT OUTER JOIN VWHRS01REL_CLCBSE_WGHFNLKPI_INFO B2 ON A.JTLCLS_RUID = B2.JTLCLS_RUID
      AND A.ACT_YEAR = B2.ACT_YEAR;
GO
