CREATE VIEW [dbo].[VWHRS01TRN_PA_SUMDEPT_INFO]
(
MSTDEPT_RUID, MSTDEPT_NM,
FINAL_SR_RUID, FINAL_SR_NM,
FINAL_COUNT
) AS
select MSTDEPT_RUID, MSTDEPT_NM,
       FINAL_SR_RUID, FINAL_SR_NM,
       SUM(FINAL_COUNT) AS FINAL_COUNT
FROM (
select MSTDEPT_RUID, MSTDEPT_NM,
       FINAL_SR_RUID, FINAL_SR_NM,
			 CASE
			   WHEN FINAL_SR_RUID IS NULL THEN 0
				 ELSE 1
			 END AS FINAL_COUNT
from VWHRS01TRN_PA_INFO
) DATA
GROUP BY MSTDEPT_RUID, MSTDEPT_NM, FINAL_SR_RUID, FINAL_SR_NM
GO
